ite the full path of the compiled launch agent to it\n    $plistbuddy -c \"add :ProgramArguments: string '$DSTROOT/Library/LaunchAgents/com.vidvox.ISFQL-Renderer.app/Contents/MacOS/com.vidvox.ISFQL-Renderer'\" $targetfile\n    \n    # if there's a global launch agent, try unloading it\n    globalLaunchAgentPlist=\"/Library/LaunchAgents/com.vidvox.ISFQL-Renderer.plist\"\n    if [ -f $globalLaunchAgentPlist ]\n    then\n        echo \"found a global launch agent, unloading it...\"\n        launchctl unload $globalLaunchAgentPlist\n    fi\n    \n    # if there's a local launch agent, reload it\n    if [ -f $targetfile ]\n    then\n        echo \"unloading any old launch agents...\"\n        launchctl unload $targetfile\n        echo \"loading the new launch agent...\"\n        launchctl load $targetfile\n    fi\n    \nfi\n\n";
